'''
给定字符串 s 和 t ，判断 s 是否为 t 的子序列。
你可以认为 s 和 t 中仅包含英文小写字母。字符串 t 可能会很长（长度 ~= 500,000），而 s 是个短字符串（长度 <=100）。
字符串的一个子序列是原始字符串删除一些（也可以不删除）字符而不改变剩余字符相对位置形成的新字符串。（例如，"ace"是"abcde"的一个子序列，而"aec"不是）。
示例 1:
s = "abc", t = "ahbgdc"
返回 true.
示例 2:
s = "axc", t = "ahbgdc"
返回 false.
后续挑战 :
如果有大量输入的 S，称作S1, S2, ... , Sk 其中 k >= 10亿，你需要依次检查它们是否为 T 的子序列。在这种情况下，你会怎样改变代码？
'''


class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        t_dict = {}
        for index, ts in enumerate(t):
            if ts not in t_dict:
                t_dict[ts] = [index, index]
            else:
                t_arr = t_dict[ts]
                if index < t_arr[0]:
                    t_arr[0] = index
                elif index > t_arr[1]:
                    t_arr[1] = index
        if s[0] not in t_dict or s[-1] not in t_dict:
            return False
        begin_min = t_dict.get(s[0])[0]
        end_max = t_dict.get(s[-1])[1]
        print(t_dict)
        for ss in s[1:-1]:
            if ss not in t_dict:
                return False
            ss_arr = t_dict[ss]
            if ss_arr[0] > end_max or ss_arr[1] < begin_min:
                return False
        return True


if __name__ == "__main__":
    solution = Solution()
    print(solution.isSubsequence('letcode', '""'))